import styles from './estilos.module.css';

 function Card(props) {
   return (
      <span className={styles.estil}>
         <img className={styles.ItemImg} src={props.image} alt={props.name} />
         <h2 className={styles.tes}>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.name}</h2>
         <div>
           <button className={styles.testx} onClick={props.onClose}>X</button>
         </div>
      </span>

   );
}
export default Card;
